import React, { useState } from "react";
import styles from "../Aievents.module.css";

export default function Aievents() {
  const [currentDate, setCurrentDate] = useState(new Date());

  const previousWeek = () => {
    const newDate = new Date(currentDate);
    newDate.setDate(newDate.getDate() - 7);
    setCurrentDate(newDate);
    console.log(currentDate);
  };

  const nextWeek = () => {
    const newDate = new Date(currentDate);
    newDate.setDate(newDate.getDate() + 7);
    setCurrentDate(newDate);
    console.log(currentDate);
  };
  const getDayName = (date) => {
    const daysOfWeek = [
      "Sunday",
      "Monday",
      "Tuesday",
      "Wednesday",
      "Thursday",
      "Friday",
      "Saturday",
    ];
    return daysOfWeek[date];
  };
  const getMonthName = (date) => {
    const monthsOfYear = [
      "January",
      "February",
      "March",
      "April",
      "May",
      "June",
      "July",
      "Aug",
      "September",
      "October",
      "November",
      "December",
    ];
    return monthsOfYear[date];
  };

  const renderDates = () => {
    const dates = [];
    for (let i = 0; i < 7; i++) {
      const date = new Date(currentDate);
      date.setDate(currentDate.getDate() + i);
      dates.push(
        <div key={i} className={styles[22]}>
          <div className={styles.jul}>
            {date.getDate()} {getMonthName(date.getMonth())}
          </div>
          <div className={styles.sun}>{getDayName(date.getDay())}</div>
        </div>
      );
    }
    return dates;
  };

  return (
    <>
      <div>
        <div>
          <div>
            <h1 className="title">AI Events</h1>
            <p className="subtitle">List of events triggered by cameras</p>
          </div>
          <div>
          <div className="tabs-container">
        <button className="tab-button active">Events</button>
        <button className="tab-button">Notifications</button>
        <button className="tab-button">Reports</button>
      </div>
            <div>
              <select className="device-dropdown">
                <option value="All Device">All Device</option>
                {/* Add more devices here */}
              </select>
              <div className="week-buttons">
                <button className="week-button">previous week</button>
                <button className="week-button">next week</button>
              </div>
            </div>
          </div>
        </div>
        <div>
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
          <div>5</div>
          <div>6</div>
          <div>7</div>
        </div>
      </div>
    </>
  );
}
